  @override
  String get termsAndConditionsText =>
      'Политика о Персональных данных  Согласие  Если Вы являетесь пользователем , мобильного приложения life app (далее приложение), то Вы соглашаетесь с применением настоящей Политики о персональных данных (кроме случаев, указанных ниже).  Ваша конфиденциальность очень важна для нас, и мы признаем важность защиты персональных данных. Поэтому мы разработали эту Политику, чтобы Вы могли понять, как мы собираем, используем, распространяем и изменяем Ваши персональные данные.  Состав персональных данных  Персональные данные — это любая информация, относящаяся к прямо или косвенно определенному или определяемому физическому лицу (гражданину). Т. е. к такой информации, в частности, можно отнести: ФИО, год, месяц, дата и место рождения, адрес, сведения о семейном, социальном, имущественном положении, сведения об образовании, профессии, доходах, а также другую информацию.  Все обрабатываемые нами персональные данные являются конфиденциальной, строго охраняемой информацией в соответствии с законодательством.  В рамках использования приложения мы  можем запросить у пользователя доступ к следующим данным:  •	Геолокация  •  •	IDFA  •	Телефонная книгу  •	Файловая система  •	Сетевое соединение (сотовая связь & Wi-Fi)  Обработка персональных данных — любое действие (операция) или совокупность действий (операций) с персональными данными, совершаемых с использованием средств автоматизации или без использования таких средств. К таким действиям (операциям) можно отнести: сбор, получение, запись, систематизацию, накопление, хранение, уточнение (обновление, изменение), извлечение, использование, передачу (распространение, предоставление, доступ), обезличивание, блокирование, удаление, уничтожение персональных данных.  Цели использования  Информация Пользователей собирается и хранится исключительно в целях оказания услуг; для идентификации и коммуникации; для предоставления Пользователю информации об оказываемых услугах и продуктах; а также для проведения анализа, технического управления и улучшения работы приложения; в маркетинговых целях; в иных других целях, указанных в настоящей Политике конфиденциальности. В рамках настоящей Политики конфиденциальности под информацией Пользователя понимается: персональная информация, которую Пользователь самостоятельно предоставляет при установке и использовании приложения, личного кабинета, а также автоматически передаваемые данные в процессе использования приложения, в том числе, но не ограничиваясь:  · Получение IDFA (Identifier For Advertisers) необходимо для идентификации мобильного устройства на котором установлено приложение. Необходимо для усиления безопасности Пользователя при использовании им приложения  · Предоставление доступа к камере устройства.  · Предоставление доступа к геолокации Пользователя  · Предоставление доступа к телефонной книге Пользователя  ·  доступ к другим  данным, повышающим удобство работы приложения  Кроме того, мы можем использовать сторонние сервисы (такие как Google Analytics). Эти сторонние сервисы имеют свои собственные политики конфиденциальности, описывающие как они используют предоставленную информацию.  Данные о местоположении, в зависимости от разрешений, установленных в Вашем браузере или устройстве. Вы можете отключить службы определения местоположения в настройках вашего устройства.  Данные, предоставляемые внешними сервисами при наличии Интеграций. Вы можете использовать внешние сервисы для взаимодействия с приложением. При таком взаимодействии Ваши персональные данные могут быть переданы в прилоежние. Кроме того, приложение  может запрашивать доступ к другим сервисам от Вашего имени, в случае наличия Интеграции с данными внешними сервисами.  Мы можем запросить у Вас персональные данные в любой момент, когда вы взаимодействуете с приложением  Доступ к камере и галерее изображений являеться обязательным для загрузки изображения профиля пользователя  Защита информации  Мы принимаем меры, чтобы гарантировать безопасное хранение и обработку Ваших данных. В число этих мер входят процессы и процедуры, направленные на снижение рисков несанкционированного доступа к Вашим данным или их разглашения. С целью обеспечения гарантий безопасности информации нами приняты необходимые организационные, технические и физические меры безопасности. Служба базы данных использует шифрование хранилища для данных и соответствует стандарту FIPS 140-2. Данные, включая резервные копии, зашифрованы на диске. Служба использует 256-разрядный шифр AES, включенный в шифрование хранилища, а ключи управляются системой. Шифрование хранилища всегда включено и не может быть отключено. Для шифрования данных на уровне транспортного протокола используется стандарт TLS 1.3  Раскрытие информации третьим лицам  Мы можем  осуществлять передачу пользовательских данных третьим лицам, для улучшения оказания услуг в прилоежнии. Пользовательские данные могут быть переданы компетентным органам по их запросу в соответствии с действующим законодательством.  Отказ от предоставления  Мы предоставляем Вам возможность отказаться от предоставления нам Ваших персональных данных, когда мы запрашиваем их. Если Вы решите отказаться от предоставления персональных данных, мы не сможем гарантировать предоставление Вам доступа к услугам приложения  Отказ о предоставлении ваших персональных данных отправьте по адресу hello@__________________________  Удаление  Вы можете запросить удаление ваших персональных данных из прилоежния. По такому запросу мы удалим все собранные о Вас персональные данные и не сможем более гарантировать предоставление доступа к приложению  Для удаления персональных данных о вас, обратитесь по адресу hello@____________________  Вы можете в любой момент обратиться к нам для удаления, изменения и предоставления Ваших персональных данных. Для этого обратитесь по адресу hello@___________________ с соответствующим запросом.  Мы можем отказаться обрабатывать запросы, которые необоснованно повторяются или систематичны, требуют непропорциональных технических усилий (например, запросов, касающихся данных, хранящейся на резервных носителях), ставящих под угрозу конфиденциальность других пользователей. В любом случае, когда мы удаляем или изменяем данные, мы выполняем эту услугу бесплатно, за исключением случаев, когда это потребует непропорциональных усилий.  Обратите внимание, что данные, которые не относятся к персональным могут сохраняться, даже если Вы прекратите использование приложения или запросите удаление персональных данных.  Конфиденциальность детей  Только лица, достигшие 14-летнего возраста, имеют разрешение на доступ к приложению.Мы не сознательно собираем личную информацию от детей младше 14 лет. Если Вы являетесь родителем или опекуном, и Вы узнаете, что ваши дети предоставили нам личную информацию, пожалуйста, свяжитесь с нами. Если мы узнаем, что мы собрали личную информацию от ребенка в возрасте до 14 лет без подтверждения родительского согласия, мы принимаем меры для удаления этой информации с наших серверов.  Изменения в этой Политике конфиденциальности  Мы оставляем за собой право обновлять или изменять нашу Политику в любое время, и Вы должны периодически проверять эту Политику конфиденциальности. Ваше дальнейшее использование приложения после внесения любых изменений в Политику конфиденциальности будет означать Ваше подтверждение изменений и Ваше согласие соблюдать и быть связанными измененной Политикой конфиденциальности. Если мы внесем какие-либо существенные изменения в настоящую Политику конфиденциальности, мы уведомим Вас либо через адрес электронной почты, который Вы нам предоставили.  ';

